function ajaxRequest(url, method, data, successCallback, errorCallback) {
  $.ajax({
    url: url,
    method: method,
    data: data,
    success: successCallback,
    error: errorCallback || function (xhr, status, error) {
      console.error("AJAX Error:", status, error, "\nResponse:", xhr.responseText);
    },
  });
}



