function createSalesChart(labels, sales) {
  const ctx = document.getElementById("salesChart").getContext("2d");
  new Chart(ctx, {
    type: "line",
    data: {
      labels: labels,
      datasets: [{
        label: "Total Sales",
        data: sales,
        backgroundColor: "rgba(75, 192, 192, 0.2)",
        borderColor: "rgba(75, 192, 192, 1)",
        borderWidth: 1,
      }],
    },
    options: {
      scales: {
        y: { beginAtZero: true, title: { display: true, text: "Total Sales" } },
        x: { title: { display: true, text: "Date" } },
      },
    },
  });
}

ajaxRequest("app/ajax/chart_data.php", "GET", {}, function (data) {
  const labels = data.map((item) => item.date);
  const sales = data.map((item) => item.total_sales);
  createSalesChart(labels, sales);
});


